import './App.css';
import Icon1 from "./icons/icon1.png";
import Icon2 from "./icons/icon2.png";
import Icon3 from "./icons/icon3.png";

function App() {

    function renderPlan(name, features, cost, buttonName, icon) {
        return (
            <div class="pricing-plan">
                <img src={icon} alt="" class="pricing-img" />
                <h2 class="pricing-header">{name}</h2>
                <ul class="pricing-features">
                    {features.map((feature) => (
                        <li class="pricing-features-item">{feature}</li>
                    ))}
                </ul>
                <span class="pricing-price">{cost}</span>
                <a href="#/" class="pricing-button">{buttonName}</a>
            </div>
        );
    }

    return (
        <div className="panel">
            {renderPlan(
                "Personal",
                ["Custom domains", "Sleeps after 30 mins of inactivity"],
                "Free",
                "Sign Up",
                Icon1
            )
            (
               "Small team",
               ["Never sleeps","Multiple workers for more powerful apps"],
               "Free",
               "Sign Up",
               Icon2
            )
            (
                "Enterprise",
                ["Dedicated","Simple horizontal scalability"],
                "$400",
            )
            }
            <div class="pricing-plan">
                <img src={Icon2} alt="" class="pricing-img" />
                <h2 class="pricing-header">Small team</h2>
                <ul class="pricing-features">
                    <li class="pricing-features-item">Never sleeps</li>
                    <li class="pricing-features-item"></li>
                </ul>
                <span class="pricing-price">$150</span>
                <a href="#/" class="pricing-button is-featured">Free trial</a>
            </div>

            <div class="pricing-plan">
                <img src={Icon3} alt="" class="pricing-img" />
                <h2 class="pricing-header">Enterprise</h2>
                <ul class="pricing-features">
                    <li class="pricing-features-item">Dedicated</li>
                    <li class="pricing-features-item"></li>
                </ul>
                <span class="pricing-price">$400</span>
                <a href="#/" class="pricing-button">Free trial</a>
            </div>

        </div>
    );
}

export default App;
